import React from 'react';
import './App.css'; // Import your CSS file here
import gmail from './resources/gmail.svg';
import call from './resources/call.svg';
import Github from './resources/github.svg';
import linkedin from './resources/linkedin.svg';


function Header() {
  return (
    <div className="header">
      <nav>
        <ul>
          <li><a href="#header">Home</a></li>
          <li><a href="#about_me">About</a></li>
          <li><a href="#getInTouch">Contact</a></li>
        </ul>
      </nav>

      <ul className="nav-icon">
        <li><a href="mailto:prashantsinghsca@gmail.com" target="_blank" rel="noopener noreferrer"><img src={gmail} alt="Gmail" /></a></li>
        <li><a href="tel:+917352579915" target="_blank" rel="noopener noreferrer"><img src={call} alt="Call" /></a></li>
        <li>
          <a href="https://github.com/prashant17d97" target="_blank" rel="noopener noreferrer">
            <img src={Github} alt="Github" />
          </a>
        </li>
        <li>
          <a href="https://www.linkedin.com/in/prashant-d97/" target="_blank" rel="noopener noreferrer">
            <img src={linkedin} alt="Linkedin" />
          </a>
        </li>
      </ul>
    </div>
  );
}

function AboutMe() {
  return (
    <div className="about_me">
      <h1 id="about_me">About Me</h1>
      <p id="detail_paragraph">Dynamic and results-driven Android Developer with extensive experience in designing, developing, and optimizing user-friendly and high-performance applications. Proficient in Agile methodologies, I have a proven track record of enhancing project velocity by 20% and reducing feature delivery time by 15%. Skilled in UI/UX design, I've successfully increased user engagement and satisfaction by 20% through the implementation of Material Design Guidelines and Material 3. Adept at integrating RESTful APIs and managing version control using Git and Bitbucket, I've consistently improved app performance and maintained clean and organized codebases. Quick learner and early adopter of new technologies, with a portfolio showcasing innovative projects developed using Kotlin Multiplatform, Kobweb, and other cutting-edge frameworks.</p>
    </div>
  );
}



function App() {
  return (
    <div>
      <Header />
      <AboutMe />
      {/* Add more components here */}
    </div>
  );
}



export default App;
